import React from 'react';
import '../ImageIcons.css'; // Asegúrate de crear este archivo de estilo

const ImageIcons = () => {
  const images = [
    { src: '../img/ic1.png', alt: 'icono1' },
    { src: '../img/ic2.png', alt: 'icono2' },
    { src: '../img/ic3.png', alt: 'icono3' },
    { src: '../img/ic4.png', alt: 'icono4' },
    { src: '../img/ic5.png', alt: 'icono5' },
    { src: '../img/ic6.png', alt: 'icono6' }
  ];

  return (
    <div className="image-icons-container">
      {images.map((image, index) => (
        <div key={index} className="image-icon">
          <img src={image.src} alt={image.alt} className="icon-image" />
          <p className="icon-label">{image.alt}</p>
        </div>
      ))}
    </div>
  );
};

export default ImageIcons;
